INSERT INTO entities (class, uri, name) VALUES ('http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#EngineeringFileFormat', 'http://129.25.20.161/gicl/index.php/Lightwave_Scene', 'Lightwave Scene');
INSERT INTO values (entity, uri, value) VALUES ('http://129.25.20.161/gicl/index.php/Lightwave_Scene', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', ' The LightWave scene file is a standard ASCII text file that contains the information necessary to reconstruct a LightWave Scene. In addition to the objects, lights and camera, the scene file contains standard Layout settings that are set on a per scene basis. Layout information that is more "permanent" is saved in the LightWave config file.  The object geometry is not included in the scene file. For each object instance the objects path and filename are listed along with other scene specific attributes. The objects are stored as seperate binary files that contain the object geometry along with the objects surface attributes.  Objects are not saved when the Save Scene function is selected from the Scene Menu. The user is required to save these by going to the Objects Menu and selecting either the Save Object or Save All Objects function. This saves each object as an individual file and sets the path and filename that will be saved for that object instance in the scene file.  Lightwave scene files (*.lws) embed the pathnames to object files (*.lwo) within them, and that object files have pathnames to image files (for textures) embedded in them. Whatever those pathnames are in those files must be valid for the directory in which you are running the application that loads the scene file. For example, if I was loading in a scene file that referred to an object file called "data/object.lwo", then the file "object.lwo" should be located in a subdirectory of this current directory called "data". ');
