INSERT INTO values (entity, uri, value) VALUES ('http://129.25.20.161/gicl/index.php/Lightwave_object', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'LightWave 3D objects are stored on disk as 3D meshes consistsing of points, polygons (which can be faces, curves or patches), and surfaces. Files can contain a single connected mesh or several disjoint meshes describing a single logical object. An object file may also contain one or more surface definitions with no mesh. ');
