INSERT INTO values (entity, uri, value) VALUES ('http://129.25.20.161/gicl/index.php/MCA', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'MCA was used by I-DEAS Web Access, a program that was merged with Unigraphs to from Unigraphs NX, now known as NX. ');
