INSERT INTO values (entity, uri, value) VALUES ('http://129.25.20.161/gicl/index.php/MCA', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasInteroperableApplication', 'Actify');
INSERT INTO values (entity, uri, value) VALUES ('http://129.25.20.161/gicl/index.php/MCA', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', 'I-DEAS Web Access was announced in 1999 by SDRC with the foal of providing web-based collaboration and visualization for use with I-DEAS software. SDRC was bought by Electronic Data System (EDS) in 2001. EDS also acquired UGS Corp, the makers of Unigraphs. EDS merged both I-DEAS and Unigraphs into one product, NX. In 2007, UGS was bought by Siemens AG who renamed the company to Siemens PLM Software.  I-DEAS Web Access files are no longer used, as the program was merged into NX in 2001 and Siemens has since been directing people away from the format, but some programs are still able to read the files.');
