INSERT INTO values (entity, uri, value) VALUES ('http://129.25.20.161/gicl/index.php/SMF', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'The SMF format describes triangular meshes by defining each 3D vertex used by the model. Triangles are  defined using the index of each vertex. This makes them difficult to modify by hand, but saves disk space. Each vertex may  also have a normal, color, texture, or texture coordinate associated with it. Some affine transformations (no shearing) can  be applied to sets of vertices to simplify the definition of a mesh or make it easier to modify components within a model. ');
