INSERT INTO values (entity, uri, value) VALUES ('http://129.25.20.161/gicl/index.php/WINGS', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', ' Wings 3D uses a winged-edge data structure (a type of BRep data structure) to store the data about the 3D model.');
