INSERT INTO values (entity, uri, value) VALUES ('http://129.25.20.161/gicl/index.php/WINGS', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasNativeApplication', 'Wings 3D');
INSERT INTO values (entity, uri, value) VALUES ('http://129.25.20.161/gicl/index.php/WINGS', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', 'Wings 3D is a modeling program that gets its name from the winged-edge data structure  that it uses to store coordinate and adjacency data. The Wings 3D program is often used for editing and texturing low  polygon-count models. The program can export to a variety of formats making it easy for these models to be used in  computer games. It seems as though users tend to use other file formats than the .wings format.');
