INSERT INTO values (entity, uri, value) VALUES ('http://brlcad.org/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasCreator', 'U.S. Army Ballistic Research Laboratory');
INSERT INTO values (entity, uri, value) VALUES ('http://brlcad.org/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', 'For more than 20 years, BRL-CAD has been the primary tri-service solid modeling CAD system used by the U.S. military to model weapons systems for vulnerability and lethality analyses. The solid modeling system is frequently used in a wide range of military, academic, and industrial applications including in the design and analysis of vehicles, mechanical parts, and architecture. The package has also been used in radiation dose planning, medical visualization, computer graphics education, CSG concepts and modeling education, and system performance benchmark testing among other purposes.  Mike Muuss began the initial architecture and design of BRL-CAD back in 1979. Development as a unified package began in 1983. The first public release was made in 1984. BRL-CAD became an open source project on December 21, 2004, with portions licensed under the LGPL and BSD licenses. ');
