INSERT INTO values (entity, uri, value) VALUES ('http://en.wikipedia.org/wiki/FBX', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'FBX files are AutoDesk 2D or 3D documents. Drawings saved in this format maintain fidelity and functionality. Additionally, this is the default type for AutoDesk authoring and interchange data. FBX is platform-independent and can hold most 3D content from a variety of vendors and platforms. FBX supports motion, 2D, audio elements, video elements, and all common 3D elements. ');
INSERT INTO values (entity, uri, value) VALUES ('http://en.wikipedia.org/wiki/FBX', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#isBinary', 'true');
