INSERT INTO values (entity, uri, value) VALUES ('http://en.wikipedia.org/wiki/FBX', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasCreator', 'Kaydara');
INSERT INTO values (entity, uri, value) VALUES ('http://en.wikipedia.org/wiki/FBX', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasInteroperableApplication', 'Alias|Wavefront PowerAnimator');
INSERT INTO values (entity, uri, value) VALUES ('http://en.wikipedia.org/wiki/FBX', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasNativeApplication', 'AutoDesk Applications');
INSERT INTO values (entity, uri, value) VALUES ('http://en.wikipedia.org/wiki/FBX', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', E'1996 - Kaydara creates the FBX format to differentiate from the FLM(FiLMBOX) format.\n\n2003 - FBX for Apple Quick Time Viewer launched by Laydara.\n\n2004-08-24 - Alias announces that it will buy Kaydara.\n\nSeptember 2004 - Purchase of Kaydara by Alias finalized.\n\n2005 - SDK developed to ensure consistency and enable support for plug-in development.\n\n2006-01-10 - AutoDesk buys Alias, gaining control of FBX format. ');
