INSERT INTO entities (class, uri, name) VALUES ('http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#EngineeringFileFormat', 'http://sketchup.google.com/', 'Google SketchUp');
INSERT INTO values (entity, uri, value) VALUES ('http://sketchup.google.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', E'SketchUp is a 3D modeling program designed for architects, civil engineers, filmmakers, game developers, and related professions. It also includes features to facilitate the placement of models in Google Earth. It was designed to be easier to use than other 3D CAD programs.\n\nA feature of SketchUp is the 3D Warehouse that lets SketchUp users search for models made by others and contribute models.');
INSERT INTO values (entity, uri, value) VALUES ('http://sketchup.google.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#documentation', 'http://sketchup.google.com/support/');
