INSERT INTO values (entity, uri, value) VALUES ('http://sketchup.google.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#createdOn', '2000-08-01');
INSERT INTO values (entity, uri, value) VALUES ('http://sketchup.google.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasFileExtension', 'skp');
INSERT INTO values (entity, uri, value) VALUES ('http://sketchup.google.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasContributor', 'Google');
INSERT INTO values (entity, uri, value) VALUES ('http://sketchup.google.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasCreator', '@Last Software');
INSERT INTO values (entity, uri, value) VALUES ('http://sketchup.google.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasNativeApplication', 'Google Sketchup');
INSERT INTO values (entity, uri, value) VALUES ('http://sketchup.google.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', E'SketchUp was developed by startup company @Last Software, Boulder, Colorado which was formed in 1999. SketchUp was first released in August 2000 as a general purpose 3D content creation tool. It won a Community Choice Award at its first tradeshow in 2000. Key to its early success was a shorter learning period than other 3D tools.  \n\nAs of SketchUp 6, features were added to allow the user to extrude and widen as well as the ability for a face to "follow" the cursor around an object.  \n\nOn March 14, 2006, Google acquired @Last Software, attracted by their plugin for Google Earth.  \n\nOn January 9, 2007, SketchUp 6 was released, featuring new tools as well as a beta version of Google SketchUp LayOut. LayOut includes 2D vector tools, as well as page layout tools intended to make it easier for professionals to create presentations without jumping to a third-party presentation program.  \n\nOn February 9, 2007, a maintenance update was released. It corrected a number of bugs, but brought no new features.  \n\nOn November 17, 2008, SketchUp 7 was released, featuring ease-of-use improvements, integration of SketchUp''s Component Browser with Google 3D Warehouse, LayOut 2, dynamic components that respond appropriately to scaling and enhanced Ruby API performance.');
INSERT INTO values (entity, uri, value) VALUES ('http://sketchup.google.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasTypicalUse', '3D Modeling');
