INSERT INTO values (entity, uri, value) VALUES ('http://usa.autodesk.com/adsk/servlet/index?siteID=123112&id=5659302', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'The chunk name defines the format of what''s contained in the chunk, which is potentially some data and/or some subchunks, in that order. If you don''t know what a particular chunk is or don''t care you can simply jump forward by length bytes from the beginning of the chunks header and arrive at the next one. Geometry is stored as one or more object chunks. The 3dschunknames.h header defines these chunk names of interest: MAIN3DS, OBJ_TRIMESH, TRI_VERTEXL, TRI_TEXCOORD etc. ');
