INSERT INTO entities (class, uri, name) VALUES ('http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#EngineeringFileFormat', 'http://usa.autodesk.com/adsk/servlet/item?siteID=123112&id=12272454&linkID=10809853', 'AutoCAD DXF');
INSERT INTO values (entity, uri, value) VALUES ('http://usa.autodesk.com/adsk/servlet/item?siteID=123112&id=12272454&linkID=10809853', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'The DXF file format is developed by AutoDesk and is used as a CAD file format. It was originally created as a way to increase interoperability between AutoCAD and other similar programs. The DXF file format was initially meant to provide exact representation of AutoCAD drawings which were natively stored in DWG(Drawing) format. Since AutoDesk did not release the DWG specification for some time, the DXF file format and the accompanying specification were meant to allow CAD drawings to be opened, edited, and exported by any CAD program. ');
