INSERT INTO entities (class, uri, name) VALUES ('http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#EngineeringFileFormat', 'http://usa.autodesk.com/adsk/servlet/ps/item?siteID=123112&id=13117479&linkID=9240657', 'AutoCAD DWG');
INSERT INTO values (entity, uri, value) VALUES ('http://usa.autodesk.com/adsk/servlet/ps/item?siteID=123112&id=13117479&linkID=9240657', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'The AutoCAD DWG format is designed for the proprietary application AutoCAD and also works with other CAD applications via a licensing agreement with AutoDesk. This is the primary CAD format used today and is capable of storing 2D and 3D data and metadata. The specification for this format has not been released by AutoDesk and there are protections placed on DWG files to prevent any unlicensed program from reading or writing DWG files.');
