INSERT INTO values (entity, uri, value) VALUES ('http://usa.autodesk.com/adsk/servlet/ps/item?siteID=123112&id=13117479&linkID=9240657', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasNativeApplication', 'AutoCAD');
INSERT INTO values (entity, uri, value) VALUES ('http://usa.autodesk.com/adsk/servlet/ps/item?siteID=123112&id=13117479&linkID=9240657', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasAdoption', 'All attempts to open or standardize this file format have been stopped by legal or software measures by AutoDesk.');
INSERT INTO values (entity, uri, value) VALUES ('http://usa.autodesk.com/adsk/servlet/ps/item?siteID=123112&id=13117479&linkID=9240657', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', E'1977 - The DWG format is invented for the Interact CAD packaged by Mike Riddle     \n\n1981 - AutoDesk co-founded by Riddle among others and Interact rewritten in C\n\n1982 - DWG file format official licensed by AutoDesk Inc.\n\n1998 - OpenDWG released as a free read/write/view DWG application.\n\n1998 - AutoDesk adds file verification scheme DWGCHECK to AutoCAD and the DWG file format.\n\n2007 - AutoCAD 2007 and DWG specification changed to include AutoDesk "TrustedDWG technology"\n\n2008 - An open alternative to the DWG format is listed as 9th on the Free Software Foundation''s High Priority Free Software Projects list. ');
