INSERT INTO values (entity, uri, value) VALUES ('http://www.anim8or.com/main/index.html', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'A .an8 file is stored as a text file and can be viewed and edited by a simple text editor such at Notepad. Files are free format much like those used by popular programming languages like C. At the text level they are similarly composed of scanner tokens such as identifiers, numbers, strings and punctutation. Tokens are organized into nested "chunks" that contain specific data used by each specific chunk. Chunks share a common format so that a parser can easily skip over unrecognized or unneeded data. The .an8 format is designed to be both forward and backward compatible to a large degree largely due to chunks.');
