INSERT INTO values (entity, uri, value) VALUES ('http://www.artcam.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', ' ArtCAM is really a family of software that offer a complete design and manufacturing solution for a wide range of industries. Designed primarily for artists over engineers, ArtCAM offers a wide variety of intuitive design tools that can be mastered easily. Furthermore, ArtCAM also contains all the tools you need to manufacture your designs in a variety of ways. The ArtCAM family of products are designed to grow with your business, offering you a fully supported route to commercial success. ');
