INSERT INTO values (entity, uri, value) VALUES ('http://www.artcam.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', ' In the late 1980s Delcam identified a common requirement during product design for the quick and efficient creation of manufacturable 3D models from 2D images & artwork. Consequently, in 1991 the first version of ArtCAM was released allowing product logos and artistic flourishes to be added to precision engineering components. ArtCAM seamlessly spans the gap between artisans and engineers, carefully combining the strengths of both approaches to form a uniquely powerful 3D modeller, but with all the simplicity of a paint package. Drawing on the expertise and technology of Delcams world-leading manufacturing software, PowerMILL, ArtCAM also provides a fully-integrated CNC or Rapid Prototype manufacturing solution. ');
