INSERT INTO values (entity, uri, value) VALUES ('http://www.artofillusion.org/documentation', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'The AOI file format is used by a program called Art of Illusion. Editing and modification of the file cannot be accomplished outside of Art of Illusion.  Art of Illusion (AoI) is an open-source software package that can be used for 3D modeling and rendering written entirely in Java. The program combines a simple user interface with powerful features usually found in high-end graphics software.');
