INSERT INTO values (entity, uri, value) VALUES ('http://www.blender.org/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasNativeApplication', 'Blender');
INSERT INTO values (entity, uri, value) VALUES ('http://www.blender.org/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', E'In 1988, Ton Roosendaal co-founded the Dutch animation studio NeoGeo. This studio quickly became the largest 3D animation house in the Netherlands. Within NeoGeo, Ton was responsible for both art direction and internal software development. After a careful deliberation it was decided that the current in-house 3D toolset needed to be rewritten from scratch. In 1995 this rewrite began and was destined to become the 3D software tool we all now know as Blender.\n\nIn 1998, Ton founded a new company called Not a Number (NaN), to further market and develop Blender. NaN''s business model involved providing commercial products and services around Blender. In 2000 the company secured growth financing by several investment companies.\n\nSadly, due to disappointing sales and the ongoing difficult economic climate, the NaN investors decided to shut down all operations early 2002. In May 2002 Ton Roosendaal started the non-profit Blender Foundation.\n\nThe Blender Foundation''s first goal was to find a way to continue developing and promoting Blender as a community based open source project. On Sunday Oct 13, 2002, Blender was released to the world under the terms of the GNU General Public License. Blender development continued since that day driven by a team of far flung dedicated volunteers from around the world led by Blender''s original creator.\n\nWith Blender originating as an in-house creation tool, the day-to-day feedback and interaction of both developing and using the software was one of its most outstanding features. In first 2.5 years of open source development, it was especially this uniqueness of Blender that has proven to be difficult to organize and maintain. Instead of getting funding to bring together software developers, the Blender Foundation decided to start a project to bring together the most outstanding artists in the Blender community and challenge them to make an exciting 3D animation movie short.\n\nBecause of the overwhelming success of the first open movie project, Ton Roosendaal, established the "Blender Institute" in summer 2007. This now is the permanent office and studio to more efficiently organize the Blender Foundation goals, but especially to coordinate and facilitate Open Projects related to 3D movies, games or visual effects. In April 2008 the Peach Project, the open movie "Big Buck Bunny", was completed in the Blender Institute. In September 2008 the open game "YoFrankie!" was released. ');
