INSERT INTO values (entity, uri, value) VALUES ('http://www.blitzbasic.com/sdkspecs/sdkspecs/b3dfile_specs.txt', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasAdoption', 'Mostly experimental game development');
INSERT INTO values (entity, uri, value) VALUES ('http://www.blitzbasic.com/sdkspecs/sdkspecs/b3dfile_specs.txt', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', 'The rationale behind the creation of this format is to allow for the generation of much richer and more complex Blitz3D scenes than is possible using established file formats - many of which do not support key features of Blitz3D, and all of which miss out on at least some features!');
