INSERT INTO entities (class, uri, name) VALUES ('http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#EngineeringFileFormat', 'http://www.ecma-international.org/publications/standards/Ecma-363.htm', 'ECMA-363');
INSERT INTO values (entity, uri, value) VALUES ('http://www.ecma-international.org/publications/standards/Ecma-363.htm', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', E'This Standard defines the syntax and semantics of the Universal 3D file format, an extensible format for downstream 3D CAD repurposing and visualization, useful for many mainstream business applications. Salient features of the U3D file format described in this document include: execution architecture that facilitates optimal run-time modification of geometry, continuous-level-of-detail, domain-specific compression, progressive data streaming and playback, free-form surfaces, key-frame and bones-based animation, and extensibility of U3D format and run-time.\n\nThe U3D file format specification does not address issues regarding rendering of 3D content. \n\nThe U3D file format specification does not address issues regarding reliability of the transport layer or communications channel. It is assumed that reliability issues will be addressed by a different protocol layer. \n\nThe U3D file format specification does not address run-time extensibility of an implementation of the U3D architecture. ');
INSERT INTO values (entity, uri, value) VALUES ('http://www.ecma-international.org/publications/standards/Ecma-363.htm', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasFileExtension', 'u3d');
INSERT INTO values (entity, uri, value) VALUES ('http://www.ecma-international.org/publications/standards/Ecma-363.htm', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasMagicNumber', 'U3D');
INSERT INTO values (entity, uri, value) VALUES ('http://www.ecma-international.org/publications/standards/Ecma-363.htm', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasContributor', 'Technical Committee 43');
INSERT INTO values (entity, uri, value) VALUES ('http://www.ecma-international.org/publications/standards/Ecma-363.htm', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasCreator', 'Ecma International');
INSERT INTO values (entity, uri, value) VALUES ('http://www.ecma-international.org/publications/standards/Ecma-363.htm', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasAdoption', 'The goal is a universal standard for three-dimensional data of all kinds, to facilitate data exchange. The consortium promoted also the development of an open source library for facilitating the adoption of the format. The format is natively supported by the PDF format and 3D objects in U3D format can be inserted into PDF documents and interactively visualized by Acrobat Reader (since version 7). ');
INSERT INTO values (entity, uri, value) VALUES ('http://www.ecma-international.org/publications/standards/Ecma-363.htm', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', E'In 2004, Ecma International formed Technical Committee 43 (TC43) to specify Universal 3D (U3D) File Format specification. The Universal 3D File Format specification is primarily intended for downstream 3D CAD repurposing and visualization purposes. The 1st Edition of the U3D File Format was adopted by the General Assembly of December 2004.\n\nIn 2005, TC43 added file format extensibility to the 2nd Edition of the U3D File Format specification. The 2nd Edition of the U3D File Format was submitted to ISO/IEC for fast-track processing.\n\nIn 2006, changes were made as a result of comments received during the ISO/IEC DIS ballot process.\n\nIn 2007, TC43 added the Free-Form Curve and Surface Extension to the 4th Edition of the U3D File Format specification that adds support for Uniform and Non-Uniform, Rational and Non-Rational Free-Form Curves and Surfaces.');
