INSERT INTO entities (class, uri, name) VALUES ('http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#EngineeringFileFormat', 'http://www.ennex.com/~fabbers/StL.asp', 'Stererlithography File');
INSERT INTO values (entity, uri, value) VALUES ('http://www.ennex.com/~fabbers/StL.asp', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'The format is incredibly simplistic. The ASCII version is only a list of faces, their normals, and the vertices that they are comprised of. Each one of these faces must be a triangle. This simplicity is due to the intended use of the file. These files are not intended to represent complex and dynamic models with animations, skeletons and textures. These models are only meant to have one position, and no color. These are the only attributes that can be fabricated by modern Stererlithography machines. ');
INSERT INTO values (entity, uri, value) VALUES ('http://www.ennex.com/~fabbers/StL.asp', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#documentation', 'http://www.ennex.com/~fabbers/StL.asp');
