INSERT INTO values (entity, uri, value) VALUES ('http://www.ennex.com/~fabbers/StL.asp', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasAdoption', 'Adopted by other organisations wishing to model 3D objects to be fabricated by 3D printers. Such organisations include Marcam and Materialise ');
INSERT INTO values (entity, uri, value) VALUES ('http://www.ennex.com/~fabbers/StL.asp', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', 'The file format was developed by 3D Systems in 1999 as a way to model the objects that would be fabricated by their 3D printers. Because of the verbosity of the ASCII version of the format, a binary format was also developed. A file in the binary format is much smaller than its ASCII counterpart, and it has meta data bits for each triangle to enable the conveyance of unforeseen information about the model. ');
