INSERT INTO values (entity, uri, value) VALUES ('http://www.khronos.org/collada/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'COLLADA is a royalty-free XML schema that enables digital asset exchange within the interactive 3D industry. ');
