INSERT INTO values (entity, uri, value) VALUES ('http://www.khronos.org/collada/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', 'Before the decision was made to start the COLLADA project, the team looked at all the existing formats and decided that, unfortunately, they needed to create a new one that would have a chance to become a standard.  Most existing formats are not open formats and have not been designed by a working group, but by a single company. That is a problem: Will all other companies agree to support a format that they have not participated in designing? But most importantly, what would happen if that one company were to disappear or decide to prioritize their support for different tools?  The main existing interchange technologies are not designed as a language, but rather as APIs (available under a license on a limited number of platforms). This enables data to be exchanged among applications that have licensed the technology, but it does not help at all to liberate the data from proprietary formats. How can one risk having one''s vital assets stored in a format that one does not have sufficient control over, including the exact specifications for?  What happened to Kaydara (being acquired by Alias) and then Alias (being acquired by Autodesk) should remind everyone of the risks of using proprietary formats, and all of us should keep asking for COLLADA to be widely supported by all DCC companies and different tool makers.');
