INSERT INTO values (entity, uri, value) VALUES ('http://www.maxon.net/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasNativeApplication', 'Cinema 4D');
INSERT INTO values (entity, uri, value) VALUES ('http://www.maxon.net/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', 'C4D was originally created by Christian and Philip Losch as a ray-tracer program for a monthly programming contest in the magazine, Kickstart. Their program won the contest. The file format was started at this time. The program Cinema 4D was originally called FastRay and released for the Amiga in 1991. Several version of Cinema 4D were released in the mid 1990''s, before being released as a production-level product in 1997. Cinema 4D is now available for Windows, Macintosh, and Linux computers. Cinema 4D has been used to create the graphics for some well known movies.');
