INSERT INTO values (entity, uri, value) VALUES ('http://www.plm.automation.siemens.com/en_us/products/open/parasolid/index.shtml', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'Parasolid XT Format is the Transmit File Format, which describes who the formats represents model information in external files.  Parasolid is a geometric modeling kernel that can represent wireframe, surface, solid, cellular and general non-manifold models. Parasolid stores topological and geometric information defining the shape of models in transmit files. These files have a published format so that applications can have access to Parasolid models without necessarily using the Parasolid kernel. The main audience for this manual is people who intend to write translators from or to the Parasolid transmit format. ');
