INSERT INTO values (entity, uri, value) VALUES ('http://zmodeler2.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasDescription', 'Zanoza Modeler (ZModeler) is a software for creating and modifying 3D artwork (models) for variouse games. Comparing to advanced 3D Graphics packages, ZModeler is not intended to produce very detailed 3D models required for photo-realistic renderings, instead, ZModeler should be used for low or average-detailed 3D models for realtime rendering in games. The more accurate you create and texture 3D models, the better they look ingame. On the other hand, high-detailed models, even while they look much more impressively, can and usually cause slowdown of game''s performance and sometime make gameplay unsatisfying. A proper balance of details, texture-work and polygons optimization is what 3D artist should be aimed to. ');
