INSERT INTO values (entity, uri, value) VALUES ('http://zmodeler2.com/', 'http://www.nationaldesignrepository.org/ontologies/formatregistry.owl#hasHistory', 'There have been 2 major versions of Zmodeler, version 1.x and version 2.x. The ZModeler2 file format is different from the ZModeler 1x series'' file format. Although ZModeler2 can open ZModeler 1 files, ZModeler 1 cannot open ZModeler2 files. Both formats have the same file extension. They are also both capable of storing unsupported data. Z3D files do not store the textures; instead, textures are separately stored as bitmaps, PNG, or other supported files types.');
